import React from 'react'


const Todo = ({todos: todo}) =>{

    const todoList = todo.length? (
        todo.map(todo=>{
            return(
                <div className="collection-item" key={todo.id}>
                    <span>{todo.content}</span>
                </div>
            )
        })
    ): 
    (
        <p className="center"> you have no tod0's left,</p>
    )
     
    
    return(
            <div className="todo collection">{todoList}</div>
     )

}

export default Todo
